import React from 'react';
import {Link} from 'react-router-dom';

const AboutMe = () =>(
<div className="about">
<h1>
    About me...
</h1>
<p>Meet Rashmi, the baker, the creative designer behind <strong>Bake More</strong> which features amazing cakes, cookies and lot more for celebration.</p>
<p>I'm Rashmi, an cheerful person loves baking, cooking and designing. I live in austin, Texas with my husband and son. <br/>
I have a passion on baking amazing stuffs.My other interest include painting,arts and crafts.
</p>


<h5>Thank you for your time. Have a nice day!</h5>
<Link to="/">
<a href="#">Go Home</a></Link>
</div>

);
export default AboutMe;
